import React from 'react';

const Card = ({ item1, data, cal1, vitE1 }) => {
  <div className="display1" style={{ width: '350px', height: '300px'}}>
    <h2>{item1.name}</h2>
    <p>{data.fg}</p>
    <p>calories: {cal1}</p>
    <p>vitamin E: {vitE1}</p>
  </div>
}

export default Card;
